(function () {
    'use strict';

    function initHeroAnimation() {
      var hero = document.querySelector(".js-hero");
      var header = document.querySelector(".js-header");
      var contact = document.querySelector(".contact-info");
      var contactButton = document.querySelector(".header__cta");
      if (hero) {
        var slideshow = function slideshow() {
          var image = gsap.utils.toArray(images);
          var allButLast = image.slice(0, -1);
          var slide = gsap.timeline({
            repeat: 0,
            delay: 0
          });
          slide.to(images, {
            display: "block",
            duration: 0.35,
            stagger: 1
          });
          slide.to(allButLast, {
            display: "none"
          });
          return slide;
        };
        var fadeOut = function fadeOut() {
          var fade = gsap.timeline({
            repeat: 0,
            delay: 0.25
          });
          fade.to(images, {
            opacity: 0,
            duration: 0.5,
            ease: "power1.out"
          });
          fade.to(tagline, {
            opacity: 0,
            duration: 0.5,
            ease: "power1.out"
          }, "<");
          return fade;
        };
        var donutDance = function donutDance() {
          var part1 = donuts.querySelector(".part-one");
          var part2 = donuts.querySelector(".part-two");
          var part3 = donuts.querySelector(".part-three");
          var part4 = donuts.querySelector(".part-four");
          var part5 = donuts.querySelector(".part-five");
          var logoParts = [part1, part2, part3, part4, part5];
          gsap.set(donuts, {
            display: "block",
            opacity: 1
          });
          gsap.set(logoParts, {
            opacity: 0
          });
          var dance = gsap.timeline({
            repeat: 0,
            delay: 0
          });
          dance.to(part1, {
            opacity: 1,
            duration: 0.5,
            ease: "power1.in"
          });
          dance.to(part5, {
            opacity: 1,
            duration: 0,
            delay: 0.75
          });
          dance.to(part3, {
            opacity: 1,
            duration: 0,
            delay: 0.75
          });
          dance.to(part4, {
            opacity: 1,
            duration: 0,
            delay: 0.75
          });
          dance.to(part2, {
            opacity: 1,
            duration: 0,
            delay: 0.75
          });
          return dance;
        };
        var showHeader = function showHeader() {
          gsap.set(header, {
            display: "block",
            opacity: 0
          });
          var nav = gsap.timeline({
            repeat: 0,
            delay: 0.65
          });
          nav.to(header, {
            opacity: 1,
            duration: 0.35,
            ease: "power1.in"
          });
          return nav;
        };
        var showContact = function showContact() {
          var slideUp = gsap.timeline({
            repeat: 0,
            delay: 0
          });
          slideUp.to(contact, {
            yPercent: 0,
            duration: 1,
            ease: "power1.in"
          });
          return slideUp;
        };
        var images = hero.querySelectorAll("img");
        var tagline = hero.querySelector("h2");
        var donuts = hero.querySelector(".wheelies-landing-logo");
        gsap.set(header, {
          display: "none"
        });
        gsap.set(images, {
          display: "none"
        });
        gsap.set(donuts, {
          display: "none"
        });
        gsap.set(contact, {
          yPercent: 100
        });
        var landingAnim = gsap.timeline();
        landingAnim.add(slideshow());
        landingAnim.add(fadeOut(), ">");
        landingAnim.add(donutDance(), ">");
        landingAnim.add(showHeader(), ">");
        contactButton.addEventListener("click", showContact);
      }
    }

    initHeroAnimation();
    // initInteractions();
    // initScrollTrigger();
    // initPageTransitions();
    // initRelatedProducts();
    // initMenu();
    // initTextSlider();
    // initAccordions();
    // initScrollingAnimations();
    // initScrollingGallery();
    // initBlog();
    // initCustomCursor();

})();
